import React from 'react';

function Contact() {
  return (
    <section className="contact bg-light text-dark py-5">
      <div className="container text-center">
        <h2>Contact Us</h2>
        <p>Feel free to reach out to us for any queries or service bookings.</p>
      </div>
    </section>
  );
}

export default Contact;
